onverted to chr. \n\nThe data is too large to analyze without coding, especially the narrow data, which are too voluminous for an Excel file. The data is inconsistently formatted and names date columns, and the CSV files, when read, had the date columns converted to chr. The data is not structured well enough to combine the segmented 2 months and then join together the different metrics recorded.\nDue to the limitations of Rstudio Cloud and Kaggle, we are only analyzing the daily activity, heart rate, weight, sleep, and METs. The data also requires outside information to provide context for the metrics and guide the analysis.\n\n# Business Goal \n\nIdentify trends in smart device usage that can be applied to Bellabeat customers to influence Bellabeat's marketing strategy.\n\n\n","metadata":{},"attachments":{"4ffc0280-d5bb-4ceb-865f-c1d946646400.png":{"image/png":""}}},{"cell_type":"markdown","source":"# Setting Up Environment \n\nLoading packages and librarying them to run.","metadata":{}},{"cell_type":"code","source":"install.packages(\"readr\")\ninstall.packages(\"tidyverse\")\ninstall.packages(\"hms\")\ninstall.packages(\"tidyr\")\nlibrary(dplyr)\nlibrary(readr)\nlibrary(ggplot2)\nlibrary(hms)\nlibrary(tidyr)","metadata":{"_kg_hide-output":true,"execution":{"iopub.status.busy":"2024-05-26T17:58:32.102339Z","iopub.execute_input":"2024-05-26T17:58:32.141305Z","iopub.status.idle":"2024-05-26T18:02:33.036703Z"},"trusted":true},"execution_count":2,"outputs":[{"name":"stderr","text":"Installing package into â€˜/usr/local/lib/R/site-libraryâ€™\n(as â€˜libâ€™ is unspecified)\n\nWarning message:\nâ€œunable to access index for repository http://cran.rstudio.com/src/contrib:\n  cannot open URL 'http://cran.rstudio.com/src/contrib/PACKAGES'â€\nWarning message:\nâ€œpackage â€˜readrâ€™ is not available for this version of R\n\nA version of this package for your version of R might be available elsewhere,\nsee the ideas at\nhttps://cran.r-project.org/doc/manuals/r-patched/R-admi