marize data_1_heartrate by Date and Id, retaining all grouping levels, dropping Time column\nheartrate1 <- data_1_heartrate %>%\n              group_by(Date, Id) %>%\n              summarise(across(-Time, ~ if(is.numeric(.)) mean(., na.rm = TRUE) else first(.)), .groups = \"drop\")\n\n# Summarize data_2_heartrate by Date and Id, retaining all grouping levels, dropping Time column\nheartrate2 <- data_2_heartrate %>%\n              group_by(Date, Id) %>%\n              summarise(across(-Time, ~ if(is.numeric(.)) mean(., na.rm = TRUE) else first(.)), .groups = \"drop\")\n\n\n# Check the formatting of the data frames\n# Put a note\ncat(\"Heart Rate 1:\\n\")\nhead(heartrate1)\n\n#Put a note\ncat(\"Heart Rate 2:\\n\")                               \nhead(heartrate2)\n        \n# Check the number of columns in each data frame\nncol_data_4 <- ncol(data_1_heartrate)\nncol_data_5 <- ncol(data_2_heartrate)\n\n# Make sure the number of columns match\n        if (ncol_data_4 != ncol_data_5) {\n          stop(\"Number of columns in data_1_heartrate and data_2_heartrate do not match.\")\n        }\n\n\n# Unioning the two tables for daily activity, unions stack on top of another verse joins, which connect from the sides on a common column\n# Combine heartrate1 and heartrate2 using rbind\nheartrate <- rbind(heartrate1, heartrate2)\n                               \n# Renaming values column to a more unique name                                \nheartrate <- heartrate %>%\n  rename(hrValue = Value)\n\n# Check the structure of the combined dataframe\ncat(\"Heart Rate:\\n\")\n# str(heartrate)\n# print(heartrate)\nhead(heartrate)\n                               \n# Check the current column names\n# colnames(heartrate)\n                               \n\n# Print a note\ncat(\"Count of Individuals in Heart Rate:\\n\")     \n                                                          \n# Check the count of Ids in data frame, should be about 14 (heartrate1 = 14 , heartrate2 =14)\n#length(unique(heartrate1$Id))\n#length(unique(heartrate2$Id))\n                               \nlength(unique(heartrate$Id))\n\n# Get unique Ids and their counts\nhr_unique_ids <- table(heartrate$Id)\n\n# Print a note\ncat(\"Individual's Ids in Heart Rate:\\n\")    \n                               \n# Print the unique Ids and their counts\nprint(hr_unique_ids)                               \n                        ","metadata":{"execution":{"iopub.status.busy":"2024-05-26T18:03:28.482167Z","iopub.execute_input":"2024-05-26T18:03:28.483787Z","iopub.status.idle":"2024-05-26T18:03:33.248019Z"},"trusted":true},"execution_count":7,"outputs":[{"name":"stdout","text":"Heart Rate 1:\n","output_type":"stream"},{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A tibble: 6 Ã— 3</caption>\n<thead>\n\t<tr><th scope=col>Date</th><th scope=col>Id</th><th scope=col>Value</th></tr>\n\t<tr><th scope=col>&lt;date&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>2016-03-29</td><td>2347167796</td><td>71.26422</td></tr>\n\t<tr><td>2016-03-30</td><td>2347167796</td><td>72.83519</td></tr>\n\t<tr><td>2016-03-30</td><td>6962181067</td><td>74.98343</td></tr>\n\t<tr><td>2016-03-31</td><td>2347167796</td><td>70.71196</td></tr>\n\t<tr><td>2016-03-31</td><td>6962181067</td><td>80.81916</td></tr>\n\t<tr><td>2016-04-01</td><td>2022484408</td><td>88.56392</td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA tibble: 6 Ã— 3\n\n| Date &lt;date&gt; | Id &lt;dbl&gt; | Value &lt;dbl&gt; |\n|---|---|---|\n| 2016-03-29 | 2347167796 | 71.26422 |\n| 2016-03-30 | 2347167796 | 72.83519 |\n| 2016-03-30 | 6962181067 | 74.98343 |\n| 2016-03-31 | 2347167796 | 70.71196 |\n| 2016-03-31 | 6962181067 | 80.81916 |\n| 2016-04-01 | 2022484408 | 88.56392 |\n\n","text/latex":"A tibble: 6 Ã— 3\n\\begin{tabular}{lll}\n Date & Id & Value\\\\\n <date> & <dbl> & <dbl>\\\\\n\\hline\n\t 2016-03-29 & 2347167796 & 71.26422\\\\\n\t 2016-03-30 & 2347167