\\\\\n\t 31 & 8253242879 &  3561.4000 &  2.5960000 &  2.5960000 &  2.5960000 & 1440.0000\\\\\n\t 32 & 8378563200 &  7762.0000 &  6.1546154 &  6.1546154 &  6.1507692 &  799.6154\\\\\n\t 33 & 8583815059 &  8050.0000 &  6.2783332 &  6.2783332 &  4.7166666 & 1440.0000\\\\\n\t 34 & 8792009665 &  1262.3077 &  0.8069231 &  0.8069231 &  0.8069231 &  850.2308\\\\\n\t 35 & 8877689391 & 12686.6667 & 10.8452379 & 10.8452379 & 10.8257145 & 1115.8095\\\\\n\\end{tabular}\n"},"metadata":{}}]},{"cell_type":"markdown","source":"# Data Analysis","metadata":{}},{"cell_type":"markdown","source":"# Daily Activity\n\nDaily Activity data consists of the following data points/metrics:\nTotalSteps, TrackerDistance, LoggedActivitiesDistance, VeryActiveDistance, LightActiveDistance, SedentaryActiveDistance, VeryActiveMinutes, FairlyActiveMinutes,  LightlyActiveMinutes, SedentaryMinutes\nIn addition to the created summary data points, Minutes and ActiveDistance.\n\nCorrelations \nThe correlations in the table below have strong positive linear relationships. Each relationship is visualized below with a trend line. It is, however, anticipatable that the activity data would correlate to itself as they are all measures of exertion.\n\nâ€¢\tTotalSteps, as opposed to exercise sessions captured in Minutes, drive individual TotalDistance, TrackerDistance, and Calories. \n\n     Therefore, users who count steps have a greater impact on their daily calories burned and distance traveled.\n\nâ€¢\tTotalDistance, TrackerDistance, and ActiveDistance all correlate to each other and TotalSteps.\n\nâ€¢\tThe greater ActiveDistance stronger impact on TotalSteps, TotalDistance, TrackerDistance, and Calories\n\n\n### Summary of Correlation Matrix for Bellabeat\n\n![image.png](attachment:14a7daf2-c4cf-4c64-a1e0-7fe947b31a32.png)","metadata":{},"attachments":{"14a7daf2-c4cf-4c64-a1e0-7fe947b31a32.png":{"image/png":""}}},{"cell_type":"markdown","source":"## Total Steps ","metadata":{}},{"cell_type":"code","source":"# Create a scatter plots for Total Steps\nggplot(bellabeat, aes(x = TotalSteps, y = TotalDistance)) +\n  geom_point(color = \"orange\") +\n  labs(title = \"TotalSteps Compared to Total Distance\") +\n   geom_smooth(method=\"lm\", se=TRUE, fullrange=FALSE, level=0.95)   # changing from auto to lm = linear\n\nggplot(bellabeat, aes(x = TotalSteps, y = TrackerDistance)) +\n  geom_point(color = \"orange\") +\n  labs(title = \"TotalSteps Compared to Tracker Distance\") +\n   geom_smooth(method=\"lm\", se=TRUE, fullrange=FALSE, level=0.95)   # changing from auto to lm = linear\n\n#Crate a scatter plot for TotalSteps and ActiveDistance\nggplot(bellabeat, aes(x = TotalSteps, y = ActiveDistance)) +\n  geom_point(color = \"orange\") +\n  labs(title = \"TotalSteps Compared to ActiveDistance\") +\n   geom_smooth(method=\"lm\", se=TRUE, fullrange=FALSE, level=0.95)   # changing from auto to lm = linear\n\n#Crate a scatter plot for TotalSteps and Calories\nggplot(bellabeat, aes(x = TotalSteps, y = Calories)) +\n  geom_point(color = \"orange\") +\n  labs(title = \"TotalSteps Compared to Calories\") +\n   geom_smooth(method=\"lm\", se=TRUE, fullrange=FALSE, level=0.95)   # changing from auto to lm = linear\n","metadata":{"execution":{"iopub.status.busy":"2024-05-26T15:43:21.484076Z","iopub.execute_input":"2024-05-26T15:43:21.485922Z","iopub.status.idle":"2024-05-26T15:43:24.820930Z"},"trusted":true},"execution_count":23,"outputs":[{"name":"stderr","text":"\u001b[1m\u001b[22m`geom_smooth()` using formula = 'y ~ x'\n\u001b[1m\u001b[22m`geom_smooth()` using formula = 'y ~ x'\n","output_type":"stream"},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ3wUVdsG8PvszPaWHpIAIZBQpRepKmADC6AiitiwPPaGoqj42EBsWFBs2JXX\nLohiQSz4CIoUASlSQi8JqdvbzHk/bAi7STYsYbMt1/+Dv+zZmd17Tybs5cyccxjnnAAAAAAg\n8SliXQAAAAAARAaCHQAAAECSQLADAAAASBIIdgAAAABJAsEOAAAAIEkg2AEAAAAkCQQ7AAAA\ngCSBYAcAAACQJBIp2K28szsLw/nrDjdfDeuf7M8YG7lwV2C