œDistribution of Daily Activity Metrics on Tuesdays, â€œyou can see the trend is true.  Overall, 31.2429% or 11 individuals were above average for each Tuesday metric. At the daily average level, 52% or 19 individuals were above the mean, demonstrating an even distribution of high-activity users.\n\n![image.png](attachment:f67c16a4-6a81-418e-85f3-a800ecf6023f.png)","metadata":{},"attachments":{"f67c16a4-6a81-418e-85f3-a800ecf6023f.png":{"image/png":""}}},{"cell_type":"markdown","source":"# Heart rate\n\nHeart rate had less participation, with only 15 users taking advantage of the feature (42.857%). It also had no correlations to other data points.\n","metadata":{}},{"cell_type":"code","source":"# Summary of column\nsummary(bellabeat$hrValue)\n\n# Creating a variable of unique Calories by Id\naverage_hr <- aggregate(hrValue ~ Id, data = bellabeat, FUN = mean)\n\n# Create a scatter plot looking for trends in average heart rate by individual (Id)\nggplot(average_hr, aes(x = Id, y = hrValue)) +\n  geom_point(color = \"orange\") +\n  labs(x = \"Id\", y = \"Average Heart Rate\", title = \"Average Heart Rate by Individual\") +\n  theme(axis.text.x = element_text(angle = 90, vjust = 0.5, hjust = 1))\n  geom_smooth(method=\"auto\", se=TRUE, fullrange=FALSE, level=0.95)\n","metadata":{"execution":{"iopub.status.busy":"2024-05-26T15:46:27.263298Z","iopub.execute_input":"2024-05-26T15:46:27.265332Z","iopub.status.idle":"2024-05-26T15:46:27.576529Z"},"trusted":true},"execution_count":28,"outputs":[{"output_type":"display_data","data":{"text/plain":"   Min. 1st Qu.  Median    Mean 3rd Qu.    Max.    NA's \n  56.75   70.71   78.91   78.93   86.08  109.82     966 "},"metadata":{}},{"output_type":"display_data","data":{"text/plain":"geom_smooth: na.rm = FALSE, orientation = NA, se = TRUE\nstat_smooth: na.rm = FALSE, orientation = NA, se = TRUE, fullrange = FALSE, level = 0.95, method = auto\nposition_identity "},"metadata":{}},{"output_type":"display_data","data":{"image/png":"iVBOR