 Summary of column\nsummary(bellabeat$WeightPounds)\n# n_distinct(bellabeat$BMI)\n\ncat(\"Count of Unique Data Points in BMI, then Fat\\n\")  \nBMI_counts <- table(bellabeat$Id, bellabeat$BMI)\nfat_counts <- table(bellabeat$Id, bellabeat$Fat)\n\n# Creating a variable of unique Calories by Id\n average_weight <- aggregate(WeightPounds ~ Id, data = bellabeat, FUN = mean)\n n_distinct(average_weight)\n\n# Create a scatter plot of Weight in pounds against BMI, too few data points to see the relationship between BMI and weight\nggplot(bellabeat, aes(x = BMI, y = WeightPounds)) +\n  geom_point(color = \"orange\")  +\n  labs(x = \"BMI\", y = \"Weight Pounds\", title = \"Weight Pounds to BMI\") +\n  theme(axis.text.x = element_text(angle = 90, vjust = 0.5, hjust = 1))\n\n# Create a scatter plot of Weight in pounds against BMI, too few data points to see the relationship between BMI and weight\nggplot(bellabeat, aes(x = Fat, y = WeightPounds)) +\n  geom_point(color = \"orange\")  +\n  labs(x = \"Fat\", y = \"Weight Pounds\", title = \"Weight Pounds to Fat\") +\n  theme(axis.text.x = element_text(angle = 90, vjust = 0.5, hjust = 1))","metadata":{"execution":{"iopub.status.busy":"2024-05-26T15:46:31.030310Z","iopub.execute_input":"2024-05-26T15:46:31.031947Z","iopub.status.idle":"2024-05-26T15:46:31.703586Z"},"trusted":true},"execution_count":29,"outputs":[{"output_type":"display_data","data":{"text/plain":"   Min. 1st Qu.  Median    Mean 3rd Qu.    Max.    NA's \n  116.0   136.0   137.8   158.1   188.3   294.3    1393 "},"metadata":{}},{"name":"stdout","text":"Count of Unique Data Points in BMI, then Fat\n","output_type":"stream"},{"output_type":"display_data","data":{"text/html":"13","text/markdown":"13","text/latex":"13","text/plain":"[1] 13"},"metadata":{}},{"name":"stderr","text":"Warning message:\nâ€œ\u001b[1m\u001b[22mRemoved 1393 rows containing missing values (`geom_point()`).â€\nWarning message:\nâ€œ\u001b[1m\u001b[22mRemoved 1533 rows containing missing values (`geo